INSERT INTO `articles` VALUES (2, 2, '广东省住房和城乡建设厅权威解读：便利港澳建筑及相关工程专业人员在粤执业', '<p>就业，乃民生之本。《粤港澳大湾区发展规划纲要》（以下简称《规划纲要》）明确提出，扩宽港澳居民就业创业空间。</p>\r\n\r\n<p>　　港澳拥有大批世界一流的<a href=\"http://jc85.com/gk/\" target=\"_blank\">专业</a>人才、与内地互补的产业结构、国际化营商环境，国际资本认可程度高，能快速融入国际经济体系。内地可以支持港澳产业落地，提供广阔内需市场、丰富的劳动力供给、就业创业机会，拓展港澳发展空间，双方可以实现互补发展。</p>\r\n\r\n<p>　　那么，广东如何为港澳居民在内地就业、创业、生活提供更加便利的条件？日前，南方日报邀请了省住房和城乡<a href=\"http://jc85.com/\" target=\"_blank\">建设</a>厅有关负责人，就《规划纲要》的有关内容进行解读。</p>\r\n\r\n<p>　　规划纲要</p>\r\n\r\n<p>　　试点允许取得<a href=\"http://jc85.com/buy/\" target=\"_blank\">建筑</a>及相关<a href=\"http://jc85.com/buy/\" target=\"_blank\">工程</a>咨询等港澳相应资质的企业和专业人士为内地市场主体直接提供服务，并逐步推出更多试点项目及开放措施。</p>\r\n\r\n<p>　　深化落实内地与香港、澳门关于建立更紧密经贸关系的安排（CEPA）对港澳服务业开放措施，鼓励粤港澳共建专业服务机构，促进会计审计、建筑及相关工程等专业服务发展。</p>\r\n\r\n<p>　　扩大香港工程建设模式实施范围，推出更多对香港建筑及相关工程业界的开放措施。</p>\r\n\r\n<p>　　&ldquo;广东实施创新驱动发展战略，强化建筑业支柱产业地位作用，建筑业现代化水平不断提高。&rdquo;省住房和城乡建设厅有关负责人介绍，按照《规划纲要》要求，广东下一步将积极作为，通过资格互认，便利港澳专业人士在粤执业；通过试行港澳工程建设管理模式，发挥港澳国际化专业服务优势。</p>\r\n\r\n<p>　　资格互认为港澳专业人士在粤执业提供便利</p>\r\n\r\n<p>　　2003年以来，在CEPA框架下，国家住房和城乡建设部开展了内地与港澳建设行业一级<a href=\"http://jc85.com/gk/\" target=\"_blank\">注册</a><a href=\"http://jc85.com/news/list-341.html\" target=\"_blank\">建筑师</a>、一级注册<a href=\"http://jc85.com/gk/list-399.html\" target=\"_blank\">结构师</a>、注册城市规划师、注册<a href=\"http://jc85.com/gk/list-398.html\" target=\"_blank\">监理工程师</a>、注册房地产估价师、注册造价<a href=\"http://jc85.com/news/list-341.html\" target=\"_blank\">工程师</a>6个专业人员资格的互认工作。据省住房和城乡建设厅统计，目前共有1630名香港专业人士通过互认取得了内地相应专业的执业资格，分别是：一级注册建筑师412人，一级注册结构工程师249人，房地产估价师276人，注册<a href=\"http://jc85.com/gk/list-398.html\" target=\"_blank\">监理</a>工程师228人，注册城市规划师66人，注册造价工程师399人。</p>\r\n\r\n<p>　　广东在国家住房和城乡建设部的支持下，先后出台了一系列先行先试措施，为取得内地互认资格的港澳专业人士在粤注册执业提供便利。取得内地互认资格的港澳专业人士可在人员注册执业办事大厅网站的&ldquo;港澳执业师在粤注册&rdquo;专栏，直接办理执业注册事项。截至2018年12月底，有55名建筑师、4名结构工程师、1名<a href=\"http://jc85.com/gk/list-421.html\" target=\"_blank\">电气</a>工程师、1名公用<a href=\"http://jc85.com/gk/list-423.html\" target=\"_blank\">设备工程师</a>（<a href=\"http://jc85.com/mall/list-250.html\" target=\"_blank\">给水</a><a href=\"http://jc85.com/mall/list-250.html\" target=\"_blank\">排水</a>）、2名监理工程师、12名房地产估价师、76名造价工程师在广东注册执业。</p>\r\n\r\n<p>　　上述负责人介绍，下一步我省还将重点推进两项举措。一方面推动内地与港澳层面的互认。广东将积极提请国家住房和城乡建设部与港澳有关方面继续开展建筑及相关工程服务领域的资格互认工作，并扩大互认范围。另一方面探索广东和港澳层面的互认。广东将积极争取国家住房和城乡建设部支持，同意广东与港澳开展二级注册建筑师、二级注册结构师、二级注册<a href=\"http://jc85.com/gk/list-396.html\" target=\"_blank\">建造师</a>的资格互认，吸引更多港澳专业人士来粤执业。</p>\r\n\r\n<p>　　试行港澳工程建设管理模式　发挥国际化专业服务优势</p>\r\n\r\n<p>　　广东近年还在自贸试验区创新项目管理模式方面取得积极进展。2016年成功在前海自贸片区项目上试点实施香港工程管理模式，允许港商独资或控股的开发建设项目自主采用香港工程建设管理模式进行管理，包括行政审批流程、管理架构、管理制度、接受委托的专业人士的执业范围、专业机构的从业许可范围等，均可采用香港建设同类工程项目所采用的管理程序和方式，经香港特别行政区政府有关部门遴选后形成的名册内的专业人士及专业机构可在前海合作区提供服务。2017年8月，横琴管委会与香港发展局签订合作协议，启动了横琴试行香港工程建设管理模式的工作。</p>\r\n\r\n<p>　　该负责人介绍，下一步广东还将推出五项举措落实有关要求。</p>\r\n\r\n<p>　　一是进一步优化专业机构和人员名册的联动管理。推动粤港、粤澳政府有关部门共同签署合作意向书，由港澳特别行政区政府有关部门提供建筑及相关工程服务专业机构和人员名册，并对名册动态更新。在广东省自贸试验区范围内采用香港工程建设管理模式的建设单位，可在名册中选择专业机构和人员，也可在同香港专业机构签订<a href=\"http://jc85.com/down/list-198.html\" target=\"_blank\">合同</a>期间，提名具备等同资历的香港专业机构申请加入名册，实现联动管理。</p>\r\n\r\n<p>　　二是探索在港澳取得建筑、规划、<a href=\"http://jc85.com/buy/list-1432.html\" target=\"_blank\">园林</a>、房地产等专业资格的专业人士在珠三角九市提供专业服务的实施办法。省住房和城乡建设厅将开展香港工程建设企业和人员资质资格比对研究，研究探索便利港澳专业人士在大湾区内地城市开业执业的进一步措施，并争取国家住房和城乡建设部支持，允许在广东先行先试。</p>\r\n\r\n<p>　　三是推出更多粤港、粤澳合作项目。联合港澳有关部门，出台加强粤港、粤澳工程建设项目合作的政策措施，在广东自贸试验区和大湾区各市确定若干具体工程建设合作项目，发挥香港优势，带动我省建筑服务水平的提高。</p>\r\n\r\n<p>　　四是构建粤港澳大湾区项目信息和人才信息库。联合港澳打造企业与企业、企业与高校、行业组织与行业组织的项目、企业、人才信息平台，引导粤港澳大湾区的建设、<a href=\"http://jc85.com/buy/list-2.html\" target=\"_blank\">施工</a>、<a href=\"http://jc85.com/down/\" target=\"_blank\">设计</a>、监理等单位加强与港澳有关企业、人员的业务合作。</p>\r\n\r\n<p>　　五是梳理和解决法律法规的障碍。推动解决港澳企业在内地投标存在的诸如资质资格条件、港澳职业保险不能在内地使用、港澳和内地的工程建设规范及标准不一致等问题。</p>', '2019-03-26 08:25:16', '2019-04-12 05:54:54', 'images/1.png', 45, 1);
